import React, { Component } from 'react'

class Media extends Component {
    constructor(props) {
        super(props)
        this.state = {
            highlight: this.props.highlight
        }
    }
    render() {
        return (
            <div className='container' style={{backgroundColor: this.state.highlight}}>
                <div className='row section-row'>
                    <h3 className='orange-text'>Midia</h3>
                    <h6>Veja algumas de nossas aparicoes na midia</h6>
                    <br></br>
                    {process.env.REACT_APP_MEDIA.split(',').map(p => 
                    <div className='col s4 card-wrap'>
                        <div className='card-panel grey lighten-5 '>
                            <img style={{border:'4px solid'+process.env.REACT_APP_COLORS_LIGHTER}} src={require("../../../static/imgs/logo-sagres.png")} alt="" class="responsive-img service-img"/>
                            <h6>{p} </h6>
                            <a class="waves-effect waves-light btn" style={{backgroundColor: process.env.REACT_APP_COLORS_DARKER}}>Visualizar</a>
                        </div>
                    </div>
                    )}
                </div>
            </div>
        )
    }
}

export default Media
